import React from 'react';
import RecipeList from './RecipeList';

function App() {
  return (
    <div className="App">
      <form onSubmit={this.searchRecipes}>
        <input name="searchIngredient" ref={this.nameRef} type="text" placeholder="Ingredient" />
        <input name="searchRecipe" ref={this.nameRef} type="text" placeholder="Recipe" />
        <button type="submit">Search Recipes</button>
      </form>
      <RecipeList />
    </div>
  );
}

export default App;
